import React from "react";
import Project from "./Project";
function Projects() {
  const projects = [
    {
      title: "FitCast",
      description:
        "A smart digital wardrobe assistant built with React, RESTful APIs, Supabase, and SQL, designed to merge your clothing collection with live weather data for daily outfit recommendations.",
      techStack: ["Svelte", "Supabase", "Git"],
      githubLink: "https://github.com/zakrab/fitcast",
    },
    {
      title: "3-2-1-Sketch",
      description:
        "Created a live sketch party game made with React, Material UI, Node, Express, and Socket.io.",
      techStack: ["React", "Material UI", "Node", "Express", "Socket.io"],
      githubLink: "https://github.com/ZakRab/3-2-1-Sketch",
    },
    {
      title: "QwikQuiz",
      description:
        "QuickQuiz is an AI-powered test review platform built with Svelte, Node, Chat GPT API, and SQL.",
      techStack: ["Svelte", "Node", "Chat GPT API", "SQL"],
      githubLink: "https://github.com/zakrab/QwikQuiz",
    },
    {
      title: "Midland Spy Codes",
      description:
        "Led the team in creating the final group project of a code names clone. Built upon React and Material UI for the front-end and Node, Express, and Socket.io for the back-end.",
      techStack: ["React", "Material UI", "Node", "Express", "Socket.io"],
      githubLink: "https://github.com/zakrab/QwikQuiz",
    },
    {
      title: "Uni-Search",
      description:
        "Created a full-stack application to help find universities I could apply to across the globe. Utilizes REST APIs to retrieve data for over 9,000 colleges and universities.",
      techStack: ["JavaScript", "REST APIs"],
      githubLink: "https://github.com/zakrab/uni-search",
    },
    {
      title: "Noorish App",
      description:
        "Noorish is a Flutter mobile application designed to assist Muslims in tracking their health and nutritional intake during the holy month of Ramadan. The app utilizes various APIs, including Alahdan.",
      techStack: ["Flutter", "Dart", "APIs"],
      githubLink: "https://github.com/zakrab/noorish",
    },
  ];
  return (
    <>
      <div className=" p-20">
        <h1 className="text-5xl">Projects</h1>
        <div className="mt-20 grid ">
          {projects.map((project) => {
            return (
              <Project
                title={project.title}
                description={project.description}
                techStack={project.techStack}
                githubLink={project.githubLink}
              />
            );
          })}
        </div>
      </div>
    </>
  );
}

export default Projects;
